const Card = ({ 
  children, 
  className = "", 
  ...props 
}) => {
  return (
    <div
      className={`rounded-lg border border-gray-200 dark:border-gray-800 bg-white dark:bg-gray-900 text-gray-900 dark:text-gray-100 shadow-sm ${className}`}
      {...props}
    >
      {children}
    </div>
  );
};

export { Card };
